// In your application code
const cloudinary = require('./config/cloudinaryConfig');


// Function to upload an image to Cloudinary
function uploadImageToCloudinary(dataURL) {
    return new Promise((resolve, reject) => {
      cloudinary.uploader.upload(dataURL, (error, result) => {
        if (error) reject(error);
        else resolve(result.url); // This is the public URL
      });
    });
  }
  
  // Example usage
  const dataURL = "data:image/png;base64,"; // Your image dataURL
  uploadImageToCloudinary(dataURL)
    .then(url => console.log('Public URL:', url))
    .catch(error => console.error('Upload failed:', error));